import React from "react";
import "./Styles/styles.css";

export const Men = () => {
  return (
    <div class="container">
      <img src="img_avatar.png" alt="Avatar" class="image" style="width:100%" />
      <div class="middle">
        <div class="text">John Doe</div>
      </div>
    </div>
  );
};

export default Men;
